import React from 'react';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import './Home.css'

const Home = () => {
  var mode = "undefined";
    // const select_normal = React.useCallback(() => {
    //     console.log("posting");
    //     //set mode variable
    //   });
    function selectNormal(props){
        mode = "normal"
    }
    function selectGod(props){
        mode = "god"
    }


      const select_god = React.useCallback(() => {
        console.log("posting");

        const formData = new FormData();
        const mode = "god";
        formData.append('mode', mode);

        fetch('http://localhost:8000/upload', {
          method: 'POST',
          body: formData,
        })
          .then((response) => response.json())
          .then((data) => console.log(data))
          .catch((error) => console.error(error));
      });


    return (
      <div className="mode_selection">
        <Link to="/Title">
          <Button onClick={selectNormal} className="Title">
            Normal
          </Button>
        </Link>
  
        <Link to="/Title">
          <Button onClick={selectGod} className="WebcamCapture">
            GodMode
          </Button>
        </Link>
      </div>
    );
  }

  export default Home
